"use strict";(self.webpackChunkscriptie=self.webpackChunkscriptie||[]).push([[53],{1109:function(e){e.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Voorwoord","href":"/","docId":"voorwoord"},{"type":"link","label":"Samenvatting","href":"/samenvatting","docId":"samenvatting"},{"type":"link","label":"Summary","href":"/summary","docId":"summary"},{"type":"link","label":"Verklarende woordenlijst","href":"/woordenlijst","docId":"woordenlijst"},{"type":"link","label":"1. Inleiding","href":"/inleiding","docId":"inleiding"},{"type":"link","label":"2. Bedrijf","href":"/bedrijf","docId":"bedrijf"},{"type":"link","label":"3. De opdracht","href":"/opdracht","docId":"opdracht"},{"type":"category","label":"Onderzoeksfase","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"4. Literatuuronderzoek","href":"/Onderzoeksfase/literatuuronderzoek","docId":"Onderzoeksfase/literatuuronderzoek"},{"type":"link","label":"5. Interviews","href":"/Onderzoeksfase/interviews","docId":"Onderzoeksfase/interviews"},{"type":"link","label":"6. Concurentie analyse","href":"/Onderzoeksfase/concurentieanalyse","docId":"Onderzoeksfase/concurentieanalyse"},{"type":"link","label":"7. SaaS Onderzoek","href":"/Onderzoeksfase/saas-onderzoek","docId":"Onderzoeksfase/saas-onderzoek"},{"type":"link","label":"8. Presentatie","href":"/Onderzoeksfase/presentatie","docId":"Onderzoeksfase/presentatie"}]},{"type":"category","label":"Ontwerpfase","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"9. Requirements","href":"/Ontwerpfase/requirements","docId":"Ontwerpfase/requirements"},{"type":"link","label":"10. Design","href":"/Ontwerpfase/design","docId":"Ontwerpfase/design"}]},{"type":"category","label":"Ontwikkelfase","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"11. Development","href":"/Ontwikkelfase/development","docId":"Ontwikkelfase/development"},{"type":"link","label":"12. Usability Test","href":"/Ontwikkelfase/usability-test","docId":"Ontwikkelfase/usability-test"}]},{"type":"link","label":"13. Conclusies en Aanbevelingen","href":"/conclusies","docId":"conclusies"},{"type":"link","label":"Evaluatie","href":"/evaluatie","docId":"evaluatie"},{"type":"link","label":"Literatuurlijst","href":"/literatuurlijst","docId":"literatuurlijst"},{"type":"link","label":"Bijlagen","href":"/bijlagen","docId":"bijlagen"}]},"docs":{"bedrijf":{"id":"bedrijf","title":"2. Bedrijf","description":"Omschrijving","sidebar":"tutorialSidebar"},"bijlagen":{"id":"bijlagen","title":"Bijlagen","description":"I.    Projectdocument","sidebar":"tutorialSidebar"},"conclusies":{"id":"conclusies","title":"13. Conclusies en Aanbevelingen","description":"De meest passende doelgroep voor Project Digital is B2B marketeers. Door Project Digital verder uit te werken tot een volwaardig SaaS platform, dat specifiek is bedoeld voor content marketing, wordt het bereik van Project Digital groter.","sidebar":"tutorialSidebar"},"evaluatie":{"id":"evaluatie","title":"Evaluatie","description":"Een van de dingen die me het meest is opgevallen tijdens deze stageperiode is hoe lastig een MVP eigenlijk is als vertrekpunt. Het is nog flexibel genoeg om te wijzigen, maar onmogelijk om helemaal om te gooien.","sidebar":"tutorialSidebar"},"inleiding":{"id":"inleiding","title":"1. Inleiding","description":"Wat hebben word, pdf en powerpoint bestanden met elkaar gemeen? Het zijn allemaal statische bestandstypes uit de vorige eeuw. Het zijn bestanden die er alleen fatsoenlijk uitzien op een computer en altijd verloren gaan ergens in een willekeurige map op Dropbox of als bijlage in een mailtje van 3 maanden terug.","sidebar":"tutorialSidebar"},"literatuurlijst":{"id":"literatuurlijst","title":"Literatuurlijst","description":"Onderstaand een volledige literatuurlijst van alle bronnen die gebruikt zijn gedurende dit project. Elk document in de bijlagen bevat een eigen bronnenlijst.","sidebar":"tutorialSidebar"},"Onderzoeksfase/concurentieanalyse":{"id":"Onderzoeksfase/concurentieanalyse","title":"6. Concurentie analyse","description":"Om te ontdekken wie de concurrentie van Project Digital is, is er een concurentieanalyse opgesteld. Op deze manier kan er gepeild worden hoe Project Digital zich tot de rest van de tools verhoudt en waar een mogelijk gat in de markt zit, oftewel een unieke insteek voor Project Digital om op in te spelen. Er is gezocht naar \u2018Content Experience Platforms\u2019, omdat de term \u2018Content Creation Platforms\u2019 niet specifiek genoeg is en in veel gevallen geen rekening houdt met de interactieve aard van de content.","sidebar":"tutorialSidebar"},"Onderzoeksfase/interviews":{"id":"Onderzoeksfase/interviews","title":"5. Interviews","description":"Ter controle van de eerdere onderzoeksresultaten en om diepere inzichten te verkrijgen in content creatie is er een tweetal interviews gehouden. Het eerste interview is met een huidige gebruiker van Project Digital, het tweede interview is gehouden met een B2B marketeer.","sidebar":"tutorialSidebar"},"Onderzoeksfase/literatuuronderzoek":{"id":"Onderzoeksfase/literatuuronderzoek","title":"4. Literatuuronderzoek","description":"Dit project is gestart met een literatuuronderzoek naar content creatie. Content creatie is het maken van uitingen, waarmee iemand een bepaalde doelgroep probeert te bereiken. Dit kunnen bijvoorbeeld teksten, foto\u2019s en video\u2019s zijn. Om een beter beeld te krijgen over de markt, waar Project Digital zich als content creatie tool wil begeven, wordt er onderzocht welke doelgroepen veel te maken hebben met content creatie en wat de doelen en prioriteiten van deze groepen zijn. Er wordt gekeken naar de content types die deze groepen maken en welke middelen ze gebruiken.","sidebar":"tutorialSidebar"},"Onderzoeksfase/presentatie":{"id":"Onderzoeksfase/presentatie","title":"8. Stakeholder presentatie","description":"Wat is de meest kansrijke doelgroep?","sidebar":"tutorialSidebar"},"Onderzoeksfase/saas-onderzoek":{"id":"Onderzoeksfase/saas-onderzoek","title":"7. SaaS Onderzoek","description":"Software-as-a-service (SaaS) is een softwaredistributiemodel, waarbij software centraal wordt gehost en op abonnementsbasis wordt aangeboden aan de gebruiker. SaaS staat ook bekend als \\"on-demand software\\" en webgebaseerde/webgehoste software.","sidebar":"tutorialSidebar"},"Ontwerpfase/design":{"id":"Ontwerpfase/design","title":"10. Design","description":"In dit hoofdstuk komt het design van Project Digital aan bod. Tot nu toe is Project Digital een Agile project geweest. Dit houdt in dat de software in losse stappen is opgebouwd en dat er incrementeel nieuwe features worden ontwikkeld. Het voordeel hiervan is dat je in kleine stappen steeds naar een tussenproduct toe werkt. Het nadeel is echter, dat een lange termijn visie ontbreekt.","sidebar":"tutorialSidebar"},"Ontwerpfase/requirements":{"id":"Ontwerpfase/requirements","title":"9. Requirements","description":"Voorbereidend op de design- en ontwikkelfase wordt er een concrete lijst met requirements opgesteld.","sidebar":"tutorialSidebar"},"Ontwikkelfase/development":{"id":"Ontwikkelfase/development","title":"11. Development","description":"In dit hoofdstuk wordt er toelichting gegeven op de geschreven code voor de nieuwe features van Project Digital.","sidebar":"tutorialSidebar"},"Ontwikkelfase/usability-test":{"id":"Ontwikkelfase/usability-test","title":"12. Usability Test","description":"Dit laatste inhoudelijke hoofdstuk beschrijft een usability test, waarin de implementatie van nieuwe en bestaande functionaliteiten van Project Digital wordt doorlopen.","sidebar":"tutorialSidebar"},"opdracht":{"id":"opdracht","title":"3. De opdracht","description":"Afgelopen jaar heeft Lam\xe9co een aantal bedrijfseigen tools ontwikkeld, waaronder een platform genaamd Project Digital. Dit is een content creatie platform, waarmee klanten responsive publicaties voor het web kunnen maken. Deze publicaties worden automatisch voorzien van de juiste huisstijl en vervolgens online gepubliceerd.","sidebar":"tutorialSidebar"},"samenvatting":{"id":"samenvatting","title":"Samenvatting","description":"In de periode van 30 augustus t/m 2 februari heb ik mijn afstudeerstage gelopen bij Lam\xe9co, een online mediabureau en ICT-dienstverlener in Eindhoven. Lam\xe9co een aantal bedrijfseigen tools ontwikkeld waaronder Project Digital. Dit is een content creatie platform, waarmee gebruikers gemakkelijk responsive webcontent kunnen maken. De content wordt automatisch voorzien van de juiste huisstijl en vervolgens gepubliceerd. Project Digital is een instapvriendelijk middel dat de afstand moet overbruggen tussen simpele e-mails/pdf\u2019s en volledige websites.","sidebar":"tutorialSidebar"},"summary":{"id":"summary","title":"Summary","description":"In the period from August 30 to February 2, I had my graduation internship at Lam\xe9co, an online media agency and ICT service provider in Eindhoven. Lam\xe9co has developed a number of tools, including Project Digital, a content creation platform, which allows users to easily create responsive web content. All content is automatically provided with the correct branding after which it is published. Project Digital is an entry-friendly tool that bridges the gap between simple emails/PDFs and full-featured websites.","sidebar":"tutorialSidebar"},"voorwoord":{"id":"voorwoord","title":"Voorwoord","description":"Beste lezer,","sidebar":"tutorialSidebar"},"woordenlijst":{"id":"woordenlijst","title":"Verklarende woordenlijst","description":"B","sidebar":"tutorialSidebar"}}}')}}]);